import React from 'react'
import { Home,Browse,Explore,CreateNft,Footer } from './Exportele'
import { Provider } from 'react-redux';
import { Store } from '../rtk/Store';
const Allindexs = () => {
  return (
    <Provider store={Store}>
          <div>
      <Home/>
      <Browse/>
      <Explore/>
      <CreateNft/>
      <Footer/>
    </div>
    </Provider>

  )
}

export default Allindexs;
